// src/App.js
import React from 'react';
import CovidMap from './components/CovidMap';  // Import the CovidMap component

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Find My Covid</h1>
      </header>
      <main>
        <CovidMap />  {/* Use the CovidMap component instead of Map */}
      </main>
    </div>
  );
}

export default App;
